// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
import "./contracts/utils/math/SafeMath.sol";
import "./contracts/access/Ownable.sol";
error ParameterException(string);

contract CalculateUtils is Ownable {
    uint256 private rate = 273;
    uint256 private vf_n = 3;

    // uint256 private TransRate ;
    //获得罚金比率
    function punishRatio(uint256 _bounts) public view returns (uint256) {
        uint256 ratio;
        if (_bounts < rate) {
            ratio = 1;
        } else if (_bounts >= rate && _bounts < rate * 1e1) {
            ratio = 1e1;
        } else if (_bounts >= rate * 1e1 && _bounts < rate * 1e2) {
            ratio = 1e2;
        } else if (_bounts >= rate * 1e2 && _bounts < rate * 1e3) {
            ratio = 1e3;
        } else if (_bounts >= rate * 1e3 && _bounts <= rate * 1e4) {
            ratio = 1e4;
        } else if (_bounts >= rate * 1e4 && _bounts <= rate * 1e5) {
            ratio = 1e5;
        } else {
            revert ParameterException(
                "Unable to calculate,Please submit a request"
            );
        }
        return ratio;
    }

    //修改汇率
    function setRate(uint256 _rate) public onlyOwner {
        rate = _rate;
    }

    //校对工作量（人） 校对人数= 翻译人数/校对工作量
    function setvfN(uint256 _vfN) public onlyOwner {
        vf_n = _vfN;
    }

    function getMatNumber(uint256 _transNumber) public view returns (uint256) {
        uint256 _maxV;
        if (_transNumber <= vf_n) {
            _maxV = 1;
        } else {
            _maxV = SafeMath.div(_transNumber, vf_n);
        }
        return _maxV;
    }

    //计算任务赏金-翻译者
    function getTaskTrans(uint256 _bounty)
        public
        pure
        returns (uint256 _money)
    {
        _money = getPercentage(_bounty, 54);
    }

    function getTaskTransEnd(uint256 _bounty)
        public
        pure
        returns (uint256 _money)
    {
        _money = getPercentage(_bounty, 24);
    }

    function getTaskTransFirst(uint256 _bounty)
        public
        pure
        returns (uint256 _money)
    {
        _money = getPercentage(_bounty, 30);
    }

    //计算任务赏金-校验者
    function getTaskVf(uint256 _bounty) public pure returns (uint256 _money) {
        _money = getPercentage(_bounty, 36);
    }

    //计算任务赏金
    function getPercentage(uint256 _number, uint256 _ratio)
        public
        pure
        returns (uint256 returnNumber)
    {
        returnNumber = SafeMath.mul(_number, _ratio) / 100;
    }

    //计算罚金
    function getPunish(uint256 _ratio, uint256 _bounty)
        public
        pure
        returns (uint256)
    {
        return SafeMath.div(_bounty, _ratio);
    }

    //计算扣除的赏金
    function getDeductMoney(uint256 _bounty, uint256 _deduct)
        public
        pure
        returns (uint256)
    {
        return getPercentage(_bounty, _deduct);
    }
}

